DROP TABLE tb_attendace;

CREATE TABLE `tb_attendace` (
  `attendance_id` int(11) NOT NULL AUTO_INCREMENT,
  `attendance_user_id` int(11) NOT NULL,
  `attendance_status` int(11) NOT NULL,
  `attendance_latitude` varchar(255) NOT NULL,
  `attendance_longitude` varchar(255) NOT NULL,
