DROP TABLE tb_schedule;

CREATE TABLE `tb_schedule` (
  `schedule_id` int(11) NOT NULL AUTO_INCREMENT,
  `schedule_title` varchar(255) NOT NULL,
  `schedule_description` varchar(255) NOT NULL,
